20250101000000	{"-- Habilitar extensões necessárias\ncreate extension if not exists \\"uuid-ossp\\"","create extension if not exists \\"pgcrypto\\"","-- Tabela de roles\nCREATE TABLE IF NOT EXISTS public.roles (\n    id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n    name text UNIQUE NOT NULL,\n    description text,\n    created_at timestamptz DEFAULT now()\n)","-- Tabela de usuários (vinculada ao auth.users do Supabase)\nCREATE TABLE IF NOT EXISTS public.users (\n    id uuid PRIMARY KEY REFERENCES auth.users(id) ON DELETE CASCADE,\n    name text,\n    email text UNIQUE NOT NULL,\n    avatar_url text,\n    created_at timestamptz DEFAULT now(),\n    updated_at timestamptz DEFAULT now()\n)","-- Tabela de clientes/empresas\nCREATE TABLE IF NOT EXISTS public.clients (\n    id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n    name text NOT NULL,\n    description text,\n    is_active boolean DEFAULT true,\n    created_at timestamptz DEFAULT now(),\n    updated_at timestamptz DEFAULT now()\n)","-- Relação usuário-cliente com role\nCREATE TABLE IF NOT EXISTS public.client_users (\n    user_id uuid REFERENCES public.users(id) ON DELETE CASCADE,\n    client_id uuid REFERENCES public.clients(id) ON DELETE CASCADE,\n    role_id uuid REFERENCES public.roles(id) ON DELETE RESTRICT,\n    created_at timestamptz DEFAULT now(),\n    PRIMARY KEY (user_id, client_id)\n)","-- Tabela de projetos\nCREATE TABLE IF NOT EXISTS public.projects (\n    id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n    name text NOT NULL,\n    description text,\n    status text DEFAULT 'active' CHECK (status IN ('active', 'paused', 'completed', 'cancelled')),\n    client_id uuid REFERENCES public.clients(id) ON DELETE CASCADE,\n    created_at timestamptz DEFAULT now(),\n    updated_at timestamptz DEFAULT now()\n)","-- Tabela de milestones\nCREATE TABLE IF NOT EXISTS public.milestones (\n    id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n    title text NOT NULL,\n    description text,\n    status text DEFAULT 'pending' CHECK (status IN ('pending', 'in_progress', 'completed', 'cancelled')),\n    project_id uuid REFERENCES public.projects(id) ON DELETE CASCADE,\n    due_date timestamptz,\n    created_at timestamptz DEFAULT now(),\n    updated_at timestamptz DEFAULT now()\n)","-- Tabela de tasks\nCREATE TABLE IF NOT EXISTS public.milestone_tasks (\n    id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n    name text NOT NULL,\n    description text,\n    status text DEFAULT 'pending' CHECK (status IN ('pending', 'in_progress', 'completed', 'cancelled')),\n    milestone_id uuid REFERENCES public.milestones(id) ON DELETE CASCADE,\n    assigned_to uuid REFERENCES public.users(id),\n    due_date timestamptz,\n    created_at timestamptz DEFAULT now(),\n    updated_at timestamptz DEFAULT now()\n)","-- Tabela de mensagens para chat\nCREATE TABLE IF NOT EXISTS public.messages (\n    id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n    content text NOT NULL,\n    user_id uuid REFERENCES public.users(id) ON DELETE CASCADE,\n    username text NOT NULL,\n    channel_id text NOT NULL,\n    mentions jsonb,\n    created_at timestamptz DEFAULT now()\n)","-- Tabela de notificações\nCREATE TABLE IF NOT EXISTS public.notifications (\n    id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n    recipient_id uuid REFERENCES public.users(id) ON DELETE CASCADE,\n    type text NOT NULL DEFAULT 'info',\n    title text NOT NULL,\n    message text,\n    data jsonb,\n    is_read boolean DEFAULT false,\n    created_at timestamptz DEFAULT now()\n)","-- Políticas RLS básicas\nALTER TABLE public.users ENABLE ROW LEVEL SECURITY","ALTER TABLE public.clients ENABLE ROW LEVEL SECURITY","ALTER TABLE public.client_users ENABLE ROW LEVEL SECURITY","ALTER TABLE public.projects ENABLE ROW LEVEL SECURITY","ALTER TABLE public.milestones ENABLE ROW LEVEL SECURITY","ALTER TABLE public.milestone_tasks ENABLE ROW LEVEL SECURITY","ALTER TABLE public.messages ENABLE ROW LEVEL SECURITY","ALTER TABLE public.notifications ENABLE ROW LEVEL SECURITY","-- Políticas básicas de acesso\nCREATE POLICY \\"Users can view their own profile\\" ON public.users\n    FOR SELECT USING (auth.uid() = id)","CREATE POLICY \\"Users can update their own profile\\" ON public.users\n    FOR UPDATE USING (auth.uid() = id)","CREATE POLICY \\"Users can view messages in their channels\\" ON public.messages\n    FOR SELECT USING (true)","-- Simplificado por enquanto\n\nCREATE POLICY \\"Users can insert messages\\" ON public.messages\n    FOR INSERT WITH CHECK (auth.uid() = user_id)","CREATE POLICY \\"Users can view their notifications\\" ON public.notifications\n    FOR SELECT USING (auth.uid() = recipient_id)","CREATE POLICY \\"Users can update their notifications\\" ON public.notifications\n    FOR UPDATE USING (auth.uid() = recipient_id)","-- Índices para performance\nCREATE INDEX IF NOT EXISTS idx_client_users_user_id ON public.client_users(user_id)","CREATE INDEX IF NOT EXISTS idx_client_users_client_id ON public.client_users(client_id)","CREATE INDEX IF NOT EXISTS idx_projects_client_id ON public.projects(client_id)","CREATE INDEX IF NOT EXISTS idx_milestones_project_id ON public.milestones(project_id)","CREATE INDEX IF NOT EXISTS idx_milestone_tasks_milestone_id ON public.milestone_tasks(milestone_id)","CREATE INDEX IF NOT EXISTS idx_messages_channel_id ON public.messages(channel_id)","CREATE INDEX IF NOT EXISTS idx_messages_user_id ON public.messages(user_id)","CREATE INDEX IF NOT EXISTS idx_notifications_recipient_id ON public.notifications(recipient_id)","-- Inserir roles básicos\nINSERT INTO public.roles (name, description) VALUES \n    ('studio_admin', 'Administrador do estúdio'),\n    ('studio_member', 'Membro do estúdio'),\n    ('client_admin', 'Administrador do cliente'),\n    ('client_member', 'Membro do cliente'),\n    ('guest', 'Usuário convidado')\nON CONFLICT (name) DO NOTHING"}	create_basic_tables
20250101000001	{"-- Criar tabela media que estava faltando\nCREATE TABLE IF NOT EXISTS public.media (\n    id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n    name text NOT NULL,\n    file_path text NOT NULL,\n    file_size bigint,\n    mime_type text,\n    width integer,\n    height integer,\n    alt_text text,\n    description text,\n    uploaded_by uuid REFERENCES public.users(id),\n    client_id uuid REFERENCES public.clients(id),\n    project_id uuid REFERENCES public.projects(id),\n    is_public boolean DEFAULT false,\n    created_at timestamptz DEFAULT now(),\n    updated_at timestamptz DEFAULT now()\n)","-- Política RLS para media\nALTER TABLE public.media ENABLE ROW LEVEL SECURITY","-- Políticas básicas de acesso para media\nCREATE POLICY \\"Users can view media from their clients\\" ON public.media\n    FOR SELECT USING (\n        client_id IN (\n            SELECT cu.client_id \n            FROM public.client_users cu \n            WHERE cu.user_id = auth.uid()\n        )\n        OR is_public = true\n    )","CREATE POLICY \\"Users can upload media\\" ON public.media\n    FOR INSERT WITH CHECK (\n        client_id IN (\n            SELECT cu.client_id \n            FROM public.client_users cu \n            WHERE cu.user_id = auth.uid()\n        )\n    )","-- Índices para performance\nCREATE INDEX IF NOT EXISTS idx_media_client_id ON public.media(client_id)","CREATE INDEX IF NOT EXISTS idx_media_project_id ON public.media(project_id)","CREATE INDEX IF NOT EXISTS idx_media_uploaded_by ON public.media(uploaded_by)","CREATE INDEX IF NOT EXISTS idx_media_mime_type ON public.media(mime_type)","CREATE INDEX IF NOT EXISTS idx_media_created_at ON public.media(created_at)"}	create_media_table
20250101000002	{"-- Criar tabelas que estavam faltando no sistema original\n\n-- Tabela de comentários em projetos\nCREATE TABLE IF NOT EXISTS public.project_comments (\n    id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n    project_id uuid REFERENCES public.projects(id) ON DELETE CASCADE,\n    user_id uuid REFERENCES public.users(id) ON DELETE CASCADE,\n    content text NOT NULL,\n    parent_id uuid REFERENCES public.project_comments(id) ON DELETE CASCADE,\n    is_resolved boolean DEFAULT false,\n    created_at timestamptz DEFAULT now(),\n    updated_at timestamptz DEFAULT now()\n)","-- Tabela de membros de projetos (para controle granular de acesso)\nCREATE TABLE IF NOT EXISTS public.project_members (\n    project_id uuid REFERENCES public.projects(id) ON DELETE CASCADE,\n    user_id uuid REFERENCES public.users(id) ON DELETE CASCADE,\n    role text DEFAULT 'member' CHECK (role IN ('owner', 'admin', 'member', 'viewer')),\n    permissions jsonb DEFAULT '{}',\n    created_by uuid REFERENCES public.users(id),\n    created_at timestamptz DEFAULT now(),\n    PRIMARY KEY (project_id, user_id)\n)","-- Tabela de atividades/logs do projeto\nCREATE TABLE IF NOT EXISTS public.project_activities (\n    id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n    project_id uuid REFERENCES public.projects(id) ON DELETE CASCADE,\n    user_id uuid REFERENCES public.users(id) ON DELETE CASCADE,\n    activity_type text NOT NULL,\n    description text NOT NULL,\n    entity_id uuid, -- ID da entidade relacionada (milestone, task, etc)\n    entity_type text, -- tipo da entidade (milestone, task, etc)\n    metadata jsonb DEFAULT '{}',\n    created_at timestamptz DEFAULT now()\n)","-- Tabela de tags/categorias\nCREATE TABLE IF NOT EXISTS public.tags (\n    id uuid PRIMARY KEY DEFAULT gen_random_uuid(),\n    name text UNIQUE NOT NULL,\n    color text DEFAULT '#6B7280',\n    client_id uuid REFERENCES public.clients(id) ON DELETE CASCADE,\n    created_at timestamptz DEFAULT now()\n)","-- Tabela de relação entre projetos e tags\nCREATE TABLE IF NOT EXISTS public.project_tags (\n    project_id uuid REFERENCES public.projects(id) ON DELETE CASCADE,\n    tag_id uuid REFERENCES public.tags(id) ON DELETE CASCADE,\n    PRIMARY KEY (project_id, tag_id)\n)","-- Políticas RLS\nALTER TABLE public.project_comments ENABLE ROW LEVEL SECURITY","ALTER TABLE public.project_members ENABLE ROW LEVEL SECURITY","ALTER TABLE public.project_activities ENABLE ROW LEVEL SECURITY","ALTER TABLE public.tags ENABLE ROW LEVEL SECURITY","ALTER TABLE public.project_tags ENABLE ROW LEVEL SECURITY","-- Políticas de acesso para project_comments\nCREATE POLICY \\"Users can view comments from their client projects\\" ON public.project_comments\n    FOR SELECT USING (\n        project_id IN (\n            SELECT p.id \n            FROM public.projects p\n            JOIN public.client_users cu ON cu.client_id = p.client_id\n            WHERE cu.user_id = auth.uid()\n        )\n    )","CREATE POLICY \\"Users can create comments on their client projects\\" ON public.project_comments\n    FOR INSERT WITH CHECK (\n        project_id IN (\n            SELECT p.id \n            FROM public.projects p\n            JOIN public.client_users cu ON cu.client_id = p.client_id\n            WHERE cu.user_id = auth.uid()\n        )\n    )","-- Políticas de acesso para project_members\nCREATE POLICY \\"Users can view project members from their clients\\" ON public.project_members\n    FOR SELECT USING (\n        project_id IN (\n            SELECT p.id \n            FROM public.projects p\n            JOIN public.client_users cu ON cu.client_id = p.client_id\n            WHERE cu.user_id = auth.uid()\n        )\n    )","-- Políticas de acesso para project_activities\nCREATE POLICY \\"Users can view activities from their client projects\\" ON public.project_activities\n    FOR SELECT USING (\n        project_id IN (\n            SELECT p.id \n            FROM public.projects p\n            JOIN public.client_users cu ON cu.client_id = p.client_id\n            WHERE cu.user_id = auth.uid()\n        )\n    )","-- Políticas de acesso para tags\nCREATE POLICY \\"Users can view tags from their clients\\" ON public.tags\n    FOR SELECT USING (\n        client_id IN (\n            SELECT cu.client_id \n            FROM public.client_users cu \n            WHERE cu.user_id = auth.uid()\n        )\n    )","-- Índices para performance\nCREATE INDEX IF NOT EXISTS idx_project_comments_project_id ON public.project_comments(project_id)","CREATE INDEX IF NOT EXISTS idx_project_comments_user_id ON public.project_comments(user_id)","CREATE INDEX IF NOT EXISTS idx_project_comments_parent_id ON public.project_comments(parent_id)","CREATE INDEX IF NOT EXISTS idx_project_members_project_id ON public.project_members(project_id)","CREATE INDEX IF NOT EXISTS idx_project_members_user_id ON public.project_members(user_id)","CREATE INDEX IF NOT EXISTS idx_project_activities_project_id ON public.project_activities(project_id)","CREATE INDEX IF NOT EXISTS idx_project_activities_user_id ON public.project_activities(user_id)","CREATE INDEX IF NOT EXISTS idx_tags_client_id ON public.tags(client_id)","CREATE INDEX IF NOT EXISTS idx_project_tags_project_id ON public.project_tags(project_id)","CREATE INDEX IF NOT EXISTS idx_project_tags_tag_id ON public.project_tags(tag_id)"}	create_missing_tables
20250101000003	{"-- UUID helper\ncreate extension if not exists \\"pgcrypto\\"","-- 1. Project templates (for Studio view)\ncreate table project_templates (\n  id          uuid        primary key default gen_random_uuid(),\n  name        text        not null,\n  description text,\n  created_at  timestamptz default now()\n)","-- 2. Assets attached to templates\n--    'media' is your existing table of files\ncreate table template_assets (\n  template_id uuid references project_templates(id) on delete cascade,\n  media_id    uuid references media(id)            on delete cascade,\n  primary key(template_id, media_id)\n)","-- 3. Folders hierarchy (both Studio & Client)\ncreate table folders (\n  id          uuid        primary key default gen_random_uuid(),\n  name        text        not null,\n  parent_id   uuid        references folders(id)      on delete cascade,\n  client_id   uuid        references clients(id)      on delete cascade,  -- for \\"Clients\\" root\n  project_id  uuid        references projects(id)     on delete cascade,  -- for client's own Projects\n  template_id uuid        references project_templates(id) on delete cascade, -- for Studio Templates\n  created_at  timestamptz default now()\n)","-- 4. Which media lives in which folder\ncreate table folder_media (\n  folder_id uuid references folders(id) on delete cascade,\n  media_id  uuid references media(id)   on delete cascade,\n  primary key(folder_id, media_id)\n)","-- Add indexes for performance\ncreate index idx_folders_parent_id on folders(parent_id)","create index idx_folders_client_id on folders(client_id)","create index idx_folders_project_id on folders(project_id)","create index idx_folders_template_id on folders(template_id)","create index idx_template_assets_template_id on template_assets(template_id)","create index idx_template_assets_media_id on template_assets(media_id)","create index idx_folder_media_folder_id on folder_media(folder_id)","create index idx_folder_media_media_id on folder_media(media_id)"}	asset_navigator_tables
20250102000000	{"-- Adicionar coluna mentions à tabela messages (se não existir)\nDO $$ \nBEGIN\n    IF NOT EXISTS (SELECT 1 FROM information_schema.columns \n                   WHERE table_name = 'messages' AND column_name = 'mentions') THEN\n        ALTER TABLE public.messages ADD COLUMN mentions jsonb;\n    END IF;\nEND $$","-- Função para processar notificações de menções\nCREATE OR REPLACE FUNCTION public.handle_mentions_notify()\nRETURNS TRIGGER AS $$\nDECLARE\n  user_id text;\nBEGIN\n  IF NEW.mentions IS NOT NULL THEN\n    -- Iterar sobre todos os usuários mencionados\n    FOR user_id IN SELECT jsonb_array_elements_text(NEW.mentions->'users') LOOP\n      -- Inserir notificação para cada usuário mencionado\n      INSERT INTO public.notifications (recipient_id, actor_id, type, project_id)\n      VALUES (user_id::uuid, NEW.user_id::uuid, 'mention', NULL);\n    END LOOP;\n  END IF;\n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql","-- Criar trigger para executar a função após inserir mensagem\nDROP TRIGGER IF EXISTS trg_notify_mentions ON public.messages","CREATE TRIGGER trg_notify_mentions\nAFTER INSERT ON public.messages\nFOR EACH ROW\nEXECUTE FUNCTION public.handle_mentions_notify()","-- Adicionar política RLS para a nova coluna (se necessário)\n-- A política já existe para mensagens, não precisamos de uma específica para mentions"}	add_mentions_to_messages
20250102000001	{"-- Corrigir função para processar notificações de menções\nCREATE OR REPLACE FUNCTION public.handle_mentions_notify()\nRETURNS TRIGGER AS $$\nDECLARE\n  mentioned_user_name text;\n  mentioned_user_id uuid;\nBEGIN\n  IF NEW.mentions IS NOT NULL THEN\n    -- Iterar sobre todos os usuários mencionados por nome\n    FOR mentioned_user_name IN SELECT jsonb_array_elements_text(NEW.mentions->'users') LOOP\n      -- Buscar o user_id baseado no nome do usuário\n      SELECT u.id INTO mentioned_user_id \n      FROM public.users u \n      WHERE LOWER(u.name) = LOWER(mentioned_user_name)\n      LIMIT 1;\n      \n      -- Se encontrou o usuário, criar notificação\n      IF mentioned_user_id IS NOT NULL THEN\n        INSERT INTO public.notifications (recipient_id, actor_id, type, project_id)\n        VALUES (mentioned_user_id, NEW.user_id::uuid, 'mention', NULL);\n      END IF;\n    END LOOP;\n  END IF;\n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql"}	fix_mentions_trigger
20250102000002	{"-- Melhorar função para processar notificações de menções\nCREATE OR REPLACE FUNCTION public.handle_mentions_notify()\nRETURNS TRIGGER AS $$\nDECLARE\n  mentioned_user_name text;\n  mentioned_user_id uuid;\n  mentioned_project_name text;\n  mentioned_milestone_name text;\n  mentioned_task_name text;\n  project_id uuid;\n  milestone_id uuid;\n  task_id uuid;\nBEGIN\n  IF NEW.mentions IS NOT NULL THEN\n    -- Processar menções de usuários\n    FOR mentioned_user_name IN SELECT jsonb_array_elements_text(NEW.mentions->'users') LOOP\n      -- Buscar o user_id baseado no nome do usuário\n      SELECT u.id INTO mentioned_user_id \n      FROM public.users u \n      WHERE LOWER(u.name) = LOWER(mentioned_user_name)\n      LIMIT 1;\n      \n      -- Se encontrou o usuário, criar notificação\n      IF mentioned_user_id IS NOT NULL THEN\n        INSERT INTO public.notifications (recipient_id, actor_id, type, project_id)\n        VALUES (mentioned_user_id, NEW.user_id::uuid, 'mention', NULL);\n      END IF;\n    END LOOP;\n\n    -- Processar menções de projetos\n    IF NEW.mentions ? 'projects' THEN\n      FOR mentioned_project_name IN SELECT jsonb_array_elements_text(NEW.mentions->'projects') LOOP\n        SELECT p.id INTO project_id\n        FROM public.projects p\n        WHERE LOWER(p.name) = LOWER(mentioned_project_name)\n        LIMIT 1;\n        \n        -- Notificar membros do projeto\n        IF project_id IS NOT NULL THEN\n          INSERT INTO public.notifications (recipient_id, actor_id, type, project_id)\n          SELECT pm.user_id, NEW.user_id::uuid, 'mention', project_id\n          FROM public.project_members pm\n          WHERE pm.project_id = project_id\n          AND pm.user_id != NEW.user_id::uuid;\n        END IF;\n      END LOOP;\n    END IF;\n\n    -- Processar menções de milestones  \n    IF NEW.mentions ? 'milestones' THEN\n      FOR mentioned_milestone_name IN SELECT jsonb_array_elements_text(NEW.mentions->'milestones') LOOP\n        SELECT m.id, m.project_id INTO milestone_id, project_id\n        FROM public.milestones m\n        WHERE LOWER(m.title) = LOWER(mentioned_milestone_name)\n        LIMIT 1;\n        \n        -- Notificar responsável do milestone e membros do projeto\n        IF milestone_id IS NOT NULL THEN\n          INSERT INTO public.notifications (recipient_id, actor_id, type, project_id)\n          SELECT pm.user_id, NEW.user_id::uuid, 'mention', project_id\n          FROM public.project_members pm\n          WHERE pm.project_id = project_id\n          AND pm.user_id != NEW.user_id::uuid;\n        END IF;\n      END LOOP;\n    END IF;\n\n    -- Processar menções de tasks\n    IF NEW.mentions ? 'tasks' THEN\n      FOR mentioned_task_name IN SELECT jsonb_array_elements_text(NEW.mentions->'tasks') LOOP\n        SELECT mt.id, m.project_id INTO task_id, project_id\n        FROM public.milestone_tasks mt\n        JOIN public.milestones m ON m.id = mt.milestone_id\n        WHERE LOWER(mt.name) = LOWER(mentioned_task_name)\n        LIMIT 1;\n        \n        -- Notificar responsável da task e membros do projeto\n        IF task_id IS NOT NULL THEN\n          INSERT INTO public.notifications (recipient_id, actor_id, type, project_id)\n          SELECT pm.user_id, NEW.user_id::uuid, 'mention', project_id\n          FROM public.project_members pm\n          WHERE pm.project_id = project_id\n          AND pm.user_id != NEW.user_id::uuid;\n        END IF;\n      END LOOP;\n    END IF;\n  END IF;\n  \n  RETURN NEW;\nEND;\n$$ LANGUAGE plpgsql"}	enhance_mentions_trigger
20250102000003	{"-- Criar view consolidada para chat que facilita as consultas por client\nCREATE OR REPLACE VIEW public.chat_consolidated_view AS\nWITH client_data AS (\n  SELECT \n    c.id as client_id,\n    c.name as client_name,\n    \n    -- Usuários do client\n    COALESCE(\n      jsonb_agg(\n        DISTINCT jsonb_build_object(\n          'id', u.id,\n          'name', u.name,\n          'email', u.email,\n          'role', r.name\n        )\n      ) FILTER (WHERE u.id IS NOT NULL), \n      '[]'::jsonb\n    ) as users,\n    \n    -- Projetos do client  \n    COALESCE(\n      jsonb_agg(\n        DISTINCT jsonb_build_object(\n          'id', p.id,\n          'name', p.name,\n          'status', p.status\n        )\n      ) FILTER (WHERE p.id IS NOT NULL),\n      '[]'::jsonb\n    ) as projects,\n    \n    -- Milestones dos projetos do client\n    COALESCE(\n      jsonb_agg(\n        DISTINCT jsonb_build_object(\n          'id', m.id,\n          'title', m.title,\n          'status', m.status,\n          'project_id', m.project_id\n        )\n      ) FILTER (WHERE m.id IS NOT NULL),\n      '[]'::jsonb\n    ) as milestones,\n    \n    -- Tasks dos milestones\n    COALESCE(\n      jsonb_agg(\n        DISTINCT jsonb_build_object(\n          'id', mt.id,\n          'name', mt.name,\n          'status', mt.status,\n          'milestone_id', mt.milestone_id\n        )\n      ) FILTER (WHERE mt.id IS NOT NULL),\n      '[]'::jsonb  \n    ) as tasks\n    \n  FROM public.clients c\n  LEFT JOIN public.client_users cu ON cu.client_id = c.id\n  LEFT JOIN public.users u ON u.id = cu.user_id\n  LEFT JOIN public.roles r ON r.id = cu.role_id\n  LEFT JOIN public.projects p ON p.client_id = c.id\n  LEFT JOIN public.milestones m ON m.project_id = p.id\n  LEFT JOIN public.milestone_tasks mt ON mt.milestone_id = m.id\n  WHERE c.is_active = true\n  GROUP BY c.id, c.name\n)\nSELECT * FROM client_data","-- Criar função helper para buscar menções por client\nCREATE OR REPLACE FUNCTION public.get_mention_suggestions(\n  client_id_param uuid,\n  mention_type text,\n  search_query text DEFAULT ''\n)\nRETURNS jsonb AS $$\nDECLARE\n  result jsonb := '[]'::jsonb;\nBEGIN\n  CASE mention_type\n    WHEN 'users' THEN\n      SELECT jsonb_agg(\n        jsonb_build_object(\n          'id', user_data->>'id',\n          'name', user_data->>'name',\n          'type', 'user'\n        )\n      ) INTO result\n      FROM chat_consolidated_view ccv,\n           jsonb_array_elements(ccv.users) as user_data\n      WHERE ccv.client_id = client_id_param\n        AND (search_query = '' OR LOWER(user_data->>'name') LIKE LOWER('%' || search_query || '%'));\n        \n    WHEN 'projects' THEN  \n      SELECT jsonb_agg(\n        jsonb_build_object(\n          'id', project_data->>'id',\n          'name', project_data->>'name', \n          'type', 'project'\n        )\n      ) INTO result\n      FROM chat_consolidated_view ccv,\n           jsonb_array_elements(ccv.projects) as project_data\n      WHERE ccv.client_id = client_id_param\n        AND (search_query = '' OR LOWER(project_data->>'name') LIKE LOWER('%' || search_query || '%'));\n        \n    WHEN 'milestones' THEN\n      SELECT jsonb_agg(\n        jsonb_build_object(\n          'id', milestone_data->>'id',\n          'name', milestone_data->>'title',\n          'type', 'milestone'\n        )\n      ) INTO result  \n      FROM chat_consolidated_view ccv,\n           jsonb_array_elements(ccv.milestones) as milestone_data\n      WHERE ccv.client_id = client_id_param\n        AND (search_query = '' OR LOWER(milestone_data->>'title') LIKE LOWER('%' || search_query || '%'));\n        \n    WHEN 'tasks' THEN\n      SELECT jsonb_agg(\n        jsonb_build_object(\n          'id', task_data->>'id', \n          'name', task_data->>'name',\n          'type', 'task'\n        )\n      ) INTO result\n      FROM chat_consolidated_view ccv,\n           jsonb_array_elements(ccv.tasks) as task_data  \n      WHERE ccv.client_id = client_id_param\n        AND (search_query = '' OR LOWER(task_data->>'name') LIKE LOWER('%' || search_query || '%'));\n  END CASE;\n  \n  RETURN COALESCE(result, '[]'::jsonb);\nEND;\n$$ LANGUAGE plpgsql"}	create_chat_consolidated_view
20250102000004	{"-- Primeiro, corrigir o tipo da coluna user_id na tabela messages\n-- Ela deveria ser uuid, não text\n-- Precisa remover a policy antes de alterar o tipo\nDROP POLICY IF EXISTS \\"Users can insert messages\\" ON public.messages","ALTER TABLE public.messages ALTER COLUMN user_id TYPE uuid USING user_id::uuid","-- Recriar a policy\nCREATE POLICY \\"Users can insert messages\\" ON public.messages\n    FOR INSERT WITH CHECK (auth.uid() = user_id)","-- Criar função melhorada para processar notificações de menções\nCREATE OR REPLACE FUNCTION public.handle_mentions_notify()\nRETURNS TRIGGER AS $$\nDECLARE\n  mentioned_user_name text;\n  mentioned_user_id uuid;\n  mentioned_project_name text;\n  mentioned_milestone_name text;\n  mentioned_task_name text;\n  project_id uuid;\n  milestone_id uuid;\n  task_id uuid;\n  notification_count integer := 0;\n  debug_info text := '';\nBEGIN\n  -- Log da função para debug\n  debug_info := format('Processing mentions for message ID: %s, User: %s, Channel: %s', \n                      NEW.id, NEW.user_id, NEW.channel_id);\n  RAISE NOTICE '%', debug_info;\n  \n  IF NEW.mentions IS NOT NULL THEN\n    RAISE NOTICE 'Mentions found: %', NEW.mentions;\n    \n    -- Processar menções de usuários\n    IF NEW.mentions ? 'users' THEN\n      RAISE NOTICE 'Processing user mentions: %', NEW.mentions->'users';\n      \n      FOR mentioned_user_name IN SELECT jsonb_array_elements_text(NEW.mentions->'users') LOOP\n        -- Buscar o user_id baseado no nome do usuário (busca mais flexível)\n        SELECT u.id INTO mentioned_user_id \n        FROM public.users u \n        WHERE LOWER(TRIM(u.name)) = LOWER(TRIM(mentioned_user_name))\n           OR LOWER(TRIM(u.email)) = LOWER(TRIM(mentioned_user_name))\n        LIMIT 1;\n        \n        IF mentioned_user_id IS NOT NULL THEN\n          INSERT INTO public.notifications (recipient_id, actor_id, type, project_id)\n          VALUES (mentioned_user_id, NEW.user_id, 'mention', NULL);\n          notification_count := notification_count + 1;\n          RAISE NOTICE 'Created user mention notification for: % (ID: %)', mentioned_user_name, mentioned_user_id;\n        ELSE\n          RAISE NOTICE 'User not found for mention: %', mentioned_user_name;\n        END IF;\n      END LOOP;\n    END IF;\n\n    -- Processar menções de projetos\n    IF NEW.mentions ? 'projects' THEN\n      RAISE NOTICE 'Processing project mentions: %', NEW.mentions->'projects';\n      \n      FOR mentioned_project_name IN SELECT jsonb_array_elements_text(NEW.mentions->'projects') LOOP\n        SELECT p.id INTO project_id\n        FROM public.projects p\n        WHERE LOWER(TRIM(p.name)) = LOWER(TRIM(mentioned_project_name))\n        LIMIT 1;\n        \n        -- Notificar membros do projeto\n        IF project_id IS NOT NULL THEN\n          INSERT INTO public.notifications (recipient_id, actor_id, type, project_id)\n          SELECT DISTINCT pm.user_id, NEW.user_id, 'mention', project_id\n          FROM public.project_members pm\n          WHERE pm.project_id = project_id\n          AND pm.user_id != NEW.user_id;\n          \n          GET DIAGNOSTICS notification_count = ROW_COUNT;\n          RAISE NOTICE 'Created % project mention notifications for: % (ID: %)', notification_count, mentioned_project_name, project_id;\n        ELSE\n          RAISE NOTICE 'Project not found for mention: %', mentioned_project_name;\n        END IF;\n      END LOOP;\n    END IF;\n\n    -- Processar menções de milestones  \n    IF NEW.mentions ? 'milestones' THEN\n      RAISE NOTICE 'Processing milestone mentions: %', NEW.mentions->'milestones';\n      \n      FOR mentioned_milestone_name IN SELECT jsonb_array_elements_text(NEW.mentions->'milestones') LOOP\n        SELECT m.id, m.project_id INTO milestone_id, project_id\n        FROM public.milestones m\n        WHERE LOWER(TRIM(m.title)) = LOWER(TRIM(mentioned_milestone_name))\n        LIMIT 1;\n        \n        -- Notificar membros do projeto do milestone\n        IF milestone_id IS NOT NULL THEN\n          INSERT INTO public.notifications (recipient_id, actor_id, type, project_id)\n          SELECT DISTINCT pm.user_id, NEW.user_id, 'mention', project_id\n          FROM public.project_members pm\n          WHERE pm.project_id = project_id\n          AND pm.user_id != NEW.user_id;\n          \n          GET DIAGNOSTICS notification_count = ROW_COUNT;\n          RAISE NOTICE 'Created % milestone mention notifications for: % (ID: %)', notification_count, mentioned_milestone_name, milestone_id;\n        ELSE\n          RAISE NOTICE 'Milestone not found for mention: %', mentioned_milestone_name;\n        END IF;\n      END LOOP;\n    END IF;\n\n    -- Processar menções de tasks\n    IF NEW.mentions ? 'tasks' THEN\n      RAISE NOTICE 'Processing task mentions: %', NEW.mentions->'tasks';\n      \n      FOR mentioned_task_name IN SELECT jsonb_array_elements_text(NEW.mentions->'tasks') LOOP\n        SELECT mt.id, m.project_id INTO task_id, project_id\n        FROM public.milestone_tasks mt\n        JOIN public.milestones m ON m.id = mt.milestone_id\n        WHERE LOWER(TRIM(mt.name)) = LOWER(TRIM(mentioned_task_name))\n        LIMIT 1;\n        \n        -- Notificar responsável da task e membros do projeto\n        IF task_id IS NOT NULL THEN\n          INSERT INTO public.notifications (recipient_id, actor_id, type, project_id)\n          SELECT DISTINCT pm.user_id, NEW.user_id, 'mention', project_id\n          FROM public.project_members pm\n          WHERE pm.project_id = project_id\n          AND pm.user_id != NEW.user_id;\n          \n          GET DIAGNOSTICS notification_count = ROW_COUNT;\n          RAISE NOTICE 'Created % task mention notifications for: % (ID: %)', notification_count, mentioned_task_name, task_id;\n        ELSE\n          RAISE NOTICE 'Task not found for mention: %', mentioned_task_name;\n        END IF;\n      END LOOP;\n    END IF;\n  ELSE\n    RAISE NOTICE 'No mentions found in message';\n  END IF;\n  \n  RETURN NEW;\nEXCEPTION\n  WHEN OTHERS THEN\n    RAISE NOTICE 'Error in handle_mentions_notify: % - %', SQLERRM, SQLSTATE;\n    RETURN NEW; -- Continue processing even if there's an error\nEND;\n$$ LANGUAGE plpgsql"}	fix_mentions_trigger_robust
20250102000005	{"-- Corrigir view consolidada para chat com coluna correta\nDROP VIEW IF EXISTS public.chat_consolidated_view","CREATE OR REPLACE VIEW public.chat_consolidated_view AS\nWITH client_data AS (\n  SELECT \n    c.id as client_id,\n    c.name as client_name,\n    \n    -- Usuários do client\n    COALESCE(\n      jsonb_agg(\n        DISTINCT jsonb_build_object(\n          'id', u.id,\n          'name', u.name,\n          'email', u.email,\n          'role', r.name\n        )\n      ) FILTER (WHERE u.id IS NOT NULL), \n      '[]'::jsonb\n    ) as users,\n    \n    -- Projetos do client  \n    COALESCE(\n      jsonb_agg(\n        DISTINCT jsonb_build_object(\n          'id', p.id,\n          'name', p.name,\n          'status', p.status\n        )\n      ) FILTER (WHERE p.id IS NOT NULL),\n      '[]'::jsonb\n    ) as projects,\n    \n    -- Milestones dos projetos do client\n    COALESCE(\n      jsonb_agg(\n        DISTINCT jsonb_build_object(\n          'id', m.id,\n          'title', m.title,\n          'status', m.status,\n          'project_id', m.project_id\n        )\n      ) FILTER (WHERE m.id IS NOT NULL),\n      '[]'::jsonb\n    ) as milestones,\n    \n    -- Tasks dos milestones\n    COALESCE(\n      jsonb_agg(\n        DISTINCT jsonb_build_object(\n          'id', mt.id,\n          'name', mt.name,\n          'status', mt.status,\n          'milestone_id', mt.milestone_id\n        )\n      ) FILTER (WHERE mt.id IS NOT NULL),\n      '[]'::jsonb  \n    ) as tasks\n    \n  FROM public.clients c\n  LEFT JOIN public.client_users cu ON cu.client_id = c.id\n  LEFT JOIN public.users u ON u.id = cu.user_id\n  LEFT JOIN public.roles r ON r.id = cu.role_id\n  LEFT JOIN public.projects p ON p.client_id = c.id  -- CORRIGIDO: client_id ao invés de company_id\n  LEFT JOIN public.milestones m ON m.project_id = p.id\n  LEFT JOIN public.milestone_tasks mt ON mt.milestone_id = m.id\n  WHERE c.is_active = true\n  GROUP BY c.id, c.name\n)\nSELECT * FROM client_data"}	